    console.log("render Main");

    return (

            <div className="container-fluid">
                <div className="row">
                    <div className="col-xl-2 col-md-auto">
                        <Navbar />
                    </div>
                    <div className="col-xl-10 col-md-auto">
                        <div className="banner">
                            <Header />  
                        </div>
                    </div>

                    <div className="content">{children}</div>
                    <Footer />
                </div>
            </div>

    );
};
